import React from "react";

function Done(props) {

    const doneTasks = function filteredTasks(){
        return props.data.filter(task => {
            return task["done"] === 1
        })
    }

  return (
    <div className="upcoming-tasks col-sm-6 col-lg-6 p-2">
      <h1 className="title">Done tasks</h1>
      <div className="board scroll upcoming-board">
        <ul className="m-4 p-0">
          {doneTasks.map((task, index) => {
            return (
              <div className="task-list list-border d-flex ">
                <div className="deadline list-border">{task.deadline}</div>
                <div className="content list-border">{task.content}</div>
                <div className="left-day expired-day list-border">Done!!</div>
              </div>
            );
          })}
        </ul>
      </div>
    </div>
  );
}

export default Done;
